import React from 'react';
import { Link } from 'react-scroll';

function Navigation() {
    const linkStyle = {
        textDecoration: 'none',
        color: '#fff',
        fontWeight: 'bold',
        marginRight: '20px',
        display: 'inline-block',
      };
  return (
    <nav className="horizontal-navigation">
      <ul>
        <li>
        <Link to="about" smooth={true} duration={500} style={linkStyle}>
            About
          </Link>
        </li>
        <li>
        <Link to="projects" smooth={true} duration={500} style={linkStyle}>
            Projects
          </Link>
        </li>
        <li>
        <Link to="contact" smooth={true} duration={500} style={linkStyle}>
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
